from utils import memo, Interval


class Solution(object):
    def eraseOverlapIntervals(self, intervals):
        """
        :type intervals: List[Interval]
        :rtype: int
        """
        # use pre to record last have not removed interval from 1 to n is faster
        n = len(intervals)
        intervals.sort(key=lambda x: (x.start, -x.end))
        # intervals.append(Interval(float('inf'), float('inf')))
        dp = [0] * (n + 1)
        for i in range(n - 2, -1, -1):
            if intervals[i + 1].start >= intervals[i].end:
                dp[i] = dp[i + 1]
            elif intervals[i + 1].end <= intervals[i].end:
                dp[i] = 1 + dp[i + 1]
            else:
                j = i + 1
                while j < n and intervals[j].start < intervals[i].end:
                    j += 1
                dp[i] = min(1 + dp[i + 1], j - i - 1 + dp[j])
        return dp[0]



